import React, { Component } from "react";

import "./Recrutement.css";

export default class Recrutement extends Component {
  render() {
    return (
      <div className="recrutementBottle general_margin">
        <h3 className="recrutementTitle">Le processus de recrutement</h3>
        <div className="recrutTiret" />
        <div class="section group">
          <div class="col span_1_of_4">
            <img src={require("../../../img/services/offres.png")} />
            <p className="black petit_texte"> Publication des offres </p>
          </div>
          <div class="col span_1_of_4">
            <img src={require("../../../img/services/offres.png")} />
            <p className="black petit_texte"> Publication des offres </p>
          </div>
          <div class="col span_1_of_4">
            <img src={require("../../../img/services/offres.png")} />
            <p className="black petit_texte"> Publication des offres </p>
          </div>
          <div class="col span_1_of_4">
            <img src={require("../../../img/services/offres.png")} />
            <p className="black petit_texte"> Publication des offres </p>
          </div>
        </div>
      </div>
    );
  }
}
